import React from "react";
import OneHome from "./oneHome";



function Home (){

  const info = [
      {id:1,   imgo:'/image/01.jpg',      location:'Aqaba',    numOfRoom:4,    price:'30000$',    phone:'+962786600991'},
      {id:2,   imgo:'/image/02.jpg',      location:'jordan',   numOfRoom:3,    price:'13356$',    phone:'+962786600991'},
      {id:3,   imgo:'/image/03.jpg',      location:'Jarash',   numOfRoom:9,    price:'25460$',    phone:'+962786600991'},
      {id:4,   imgo:'/image/04.jpg',      location:'Qouzom',   numOfRoom:6,    price:'78946$',    phone:'+962786600991'},
      {id:5,   imgo:'/image/05.jpg',      location:'Wenz',     numOfRoom:14,   price:'14793$',    phone:'+962786600991'},
      {id:6,   imgo:'/image/05.jpg',      location:'NewYork',  numOfRoom:12,   price:'79286$',    phone:'+962786600991'},
      {id:7,   imgo:'/image/06.jpg',      location:'UK',       umOfRoom:9,     price:'19786$',    phone:'+962786600991'},
      {id:8,   imgo:'/image/03.jpg',      location:'USA',      numOfRoom:7,     price:'19800$',   phone:'+962786600991'}
  ]
  const singleHome =info.map(function(singleHome){
      return <OneHome 
      imgo={singleHome.imgo}
      location={singleHome.location}
      numOfRoom={singleHome.numOfRoom}
      price={singleHome.price}
      phone={singleHome.phone}
      
      />
  });

    return(
        <div className="row">
            {singleHome}
        </div>
    )
}
export default Home
